import axios from 'axios'

/*
* 发送请求获取成绩数据*/
export default function request(studentID, studentPassword){

  return new Promise((resolve, reject)=>{
    axios({
      method: 'post',
      datatype: 'json',
      url: 'http://localhost:1323/test',
      data: {
        Sid: studentID,
        Pwd: studentPassword,
      }
    })
  })
};
